function test(arr, n) {
    arr = arr.split(' ').map(i => i - '0');
    n = arr.length;
    let yes = false;
    let i = 0;
    while( i < n) {
        let tmp = [];
        while(arr[i + 1] && arr[i] > arr[i + 1]) {
            tmp.push(arr[i]);
            i ++;
        }
        if(arr[i] && arr[i - 1] && arr[i] < arr[i - 1]) {
            tmp.push(arr[i]);
            i ++;
        }
        if(arr[i] && arr[i] > tmp[0]) {
            yes = true;
            break;
        }
        i ++;
    }
    if(yes) {
        console.log('yes')
    }else{
        console.log('no')
    }
}

